import React, {Fragment} from "react";


import 'bootstrap/dist/css/bootstrap.min.css';

const InputTodo = () => {
    return (
        <Fragment>
            <h1 className="text-center mt-5" >Pern Todo List</h1>
        </Fragment>
    )
}

export default InputTodo;
